import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { TonConnectButton } from '@tonconnect/ui-react';
import { FaRobot, FaDumbbell, FaGamepad, FaDragon, FaWallet, FaCog } from 'react-icons/fa';

const AppContainer = styled.div`
  min-height: 100vh;
  background: #FF0000;
  color: white;
  padding: 20px;
  position: relative;
  overflow-x: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 60px;
    background: #FF0000;
    border-bottom: 4px solid #CC0000;
  }
`;

const TopIndicators = styled.div`
  position: absolute;
  top: 20px;
  left: 20px;
  display: flex;
  gap: 10px;
  z-index: 2;

  &::before {
    content: '';
    width: 50px;
    height: 50px;
    background: #7BB7E7;
    border-radius: 50%;
    border: 4px solid white;
    box-shadow: 0 0 0 2px #333;
  }

  &::after {
    content: '';
    display: flex;
    gap: 10px;
  }
`;

const SmallLights = styled.div`
  display: flex;
  gap: 8px;
  margin-left: 10px;
  align-items: center;

  &::before {
    content: '';
    width: 12px;
    height: 12px;
    background: #FF0000;
    border-radius: 50%;
    border: 2px solid #CC0000;
  }

  &::after {
    content: '';
    width: 12px;
    height: 12px;
    background: #FFFF00;
    border-radius: 50%;
    border: 2px solid #CC9900;
  }

  div {
    width: 12px;
    height: 12px;
    background: #00FF00;
    border-radius: 50%;
    border: 2px solid #009900;
  }
`;

const Content = styled.div`
  background: #DDDDDD;
  border-radius: 15px;
  border: 20px solid white;
  margin-top: 80px;
  padding: 20px;
  position: relative;
  box-shadow: inset 0 0 20px rgba(0, 0, 0, 0.2);
  min-height: calc(100vh - 140px);

  &::before {
    content: '';
    position: absolute;
    top: -25px;
    right: 20px;
    width: 10px;
    height: 10px;
    background: #FF0000;
    border-radius: 50%;
    box-shadow: -15px 0 0 #FF0000;
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 20px;
  margin-top: 20px;
`;

const ActionButton = styled(motion.button)`
  background: white;
  border: none;
  border-radius: 10px;
  padding: 20px;
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  gap: 15px;
  color: #333;
  font-size: 1.2rem;
  font-weight: 600;
  cursor: pointer;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  position: relative;
  overflow: hidden;

  &:hover {
    background: #f8f8f8;
    transform: translateY(-2px);
    box-shadow: 0 6px 12px rgba(0, 0, 0, 0.15);
  }

  &:active {
    transform: translateY(1px);
  }

  svg {
    font-size: 2rem;
    color: #FF0000;
  }
`;

const ButtonDescription = styled.p`
  font-size: 0.9rem;
  color: #666;
  margin: 0;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 2rem;
  color: #333;
  margin: 0 0 20px 0;
  text-align: center;
  font-weight: 800;
`;

const ConnectButtonWrapper = styled.div`
  width: 100%;
  max-width: 300px;
  margin: 0 auto 20px;

  :deep(.tc-button) {
    background: #FF0000 !important;
    color: white !important;
    border: none !important;
    border-radius: 10px !important;
    padding: 12px 24px !important;
    font-size: 1.1rem !important;
    font-weight: 600 !important;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2) !important;
    width: 100% !important;

    &:hover {
      background: #CC0000 !important;
      transform: translateY(-2px) !important;
      box-shadow: 0 6px 12px rgba(0, 0, 0, 0.3) !important;
    }

    &:active {
      transform: translateY(1px) !important;
    }
  }
`;

const Controls = styled.div`
  position: absolute;
  bottom: 20px;
  right: 20px;
  display: flex;
  gap: 20px;
  align-items: center;

  &::before {
    content: '';
    width: 40px;
    height: 40px;
    background: #333;
    border-radius: 50%;
  }

  &::after {
    content: '';
    width: 60px;
    height: 8px;
    background: #333;
    border-radius: 4px;
  }
`;

const DPad = styled.div`
  width: 80px;
  height: 80px;
  background: #333;
  position: relative;
  clip-path: polygon(33% 0%, 66% 0%, 66% 33%, 100% 33%, 100% 66%, 66% 66%, 66% 100%, 33% 100%, 33% 66%, 0% 66%, 0% 33%, 33% 33%);
`;

function App() {
  return (
    <AppContainer>
      <TopIndicators>
        <SmallLights>
          <div />
        </SmallLights>
      </TopIndicators>
      <Content>
        <Title>AI POKEMONS</Title>
        <ConnectButtonWrapper>
          <TonConnectButton />
        </ConnectButtonWrapper>
        <Grid>
          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaRobot />
            AI Resources
            <ButtonDescription>Управляйте ресурсами и характеристиками ваших покемонов</ButtonDescription>
          </ActionButton>

          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaDumbbell />
            Training
            <ButtonDescription>Тренируйте и улучшайте навыки ваших покемонов</ButtonDescription>
          </ActionButton>

          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaGamepad />
            Farm Arena
            <ButtonDescription>Участвуйте в сражениях и получайте награды</ButtonDescription>
          </ActionButton>

          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaDragon />
            My Pokemons
            <ButtonDescription>Управляйте своей коллекцией NFT покемонов</ButtonDescription>
          </ActionButton>

          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaWallet />
            Wallet
            <ButtonDescription>Управляйте балансом и транзакциями</ButtonDescription>
          </ActionButton>

          <ActionButton whileHover={{ scale: 1.02 }} whileTap={{ scale: 0.98 }}>
            <FaCog />
            Settings
            <ButtonDescription>Настройте приложение под себя</ButtonDescription>
          </ActionButton>
        </Grid>
        <Controls>
          <DPad />
        </Controls>
      </Content>
    </AppContainer>
  );
}

export default App;
